//	Модел 29102 - Поглед на хамелеон и на изненадан лемур
//	П. Бойчев, 2017



// конструктор на модела
MEIRO.Models.M29102 = function M29102(room)
{
	MEIRO.Model.apply(this, arguments);

	// текстура
	// преобразувана с http://dataurl.net/#dataurlmaker
	var eyeData = 'data:image/jpeg;base64,';
	this.eyeMap = new THREE.TextureLoader().load(eyeData);
	this.eyeMap.anisotropy = 8;
	this.eyeMap.repeat.set(1,1);
	
	var material = new THREE.MeshPhongMaterial({
		map:this.eyeMap,
		shininess:200});

	this.eyeA = new THREE.Mesh(MEIRO.PRIMITIVE.GEOMETRY.SPHERE,material);
	this.eyeB = new THREE.Mesh(MEIRO.PRIMITIVE.GEOMETRY.SPHERE,material);

	this.eyeA.position.set(0,0,-2);
	this.eyeB.position.set(0,0,2);
		
	this.fly = new THREE.Mesh(MEIRO.PRIMITIVE.GEOMETRY.SPHERE,MEIRO.PRIMITIVE.STYLE.PAWN);
	this.fly.scale.set(0.1,0.1,0.1);

	this.fly2 = new THREE.Mesh(MEIRO.PRIMITIVE.GEOMETRY.SPHERE,MEIRO.PRIMITIVE.STYLE.PAWN);
	this.fly2.scale.set(0.1,0.1,0.1);

	var that = this;
	this.state = 0;
	this.k = 1;
	this.w = 1;
	this.toggle = new MEIRO.CornerButton('topLeft', function(){that.onToggle();}, 'ФОКУСИРАНЕ', 'images/toggle.png');
	this.wide = new MEIRO.CornerButton('topRight', function(){that.onWide();}, 'ОКОКОРВАНЕ', 'images/show.hide.png');
	this.toggle.hide();
	this.wide.hide();
	
	// сглобяване на целия модел	
	this.image.add(this.eyeA,this.eyeB,this.fly,this.fly2);
}

MEIRO.Models.M29102.prototype = Object.create(MEIRO.Model.prototype);

MEIRO.Models.M29102.DIST = {MIN:5, MAX:30, HEIGHT:0};
MEIRO.Models.M29102.POS = {DIST:15, ROT_X:0, ROT_Y:0};
MEIRO.Models.M29102.ROT_Y = {MIN:-0.1, MAX:0.7};


// аниматор на модела
MEIRO.Models.M29102.prototype.onAnimate = function(time)
{
	this.eyeMap.repeat.set(1,this.w);
	
	var alpha2 = 0.4*Math.cos(rpm(time,21))-0.4*Math.cos(rpm(time,31));
	var beta2 = 0.3*Math.cos(rpm(time,25))-0.3*Math.sin(rpm(time,37));;
	
	this.fly2.position.set(
		5*Math.cos(-alpha2)*Math.cos(beta2),
		5*Math.sin(beta2),
		5*Math.sin(-alpha2)*Math.cos(beta2)
	);
	
	var alpha = 0.4*Math.sin(rpm(time,20))+0.4*Math.cos(rpm(time,33));
	var beta = 0.3*Math.cos(rpm(time,17))+0.3*Math.sin(rpm(time,27));;
	
	this.fly.position.set(
		5*Math.cos(-alpha)*Math.cos(beta),
		5*Math.sin(beta),
		5*Math.sin(-alpha)*Math.cos(beta)
	);

	this.k = THREE.Math.lerp(this.k,1,0.01);
	var k = this.k;
	switch (this.state)
	{
		case 0:
			this.fly2.visible = false;
			this.eyeA.rotation.set(0,THREE.Math.lerp(this.eyeA.rotation.y,alpha-0.4,k),THREE.Math.lerp(this.eyeA.rotation.z,beta-Math.PI/2,k),'XYZ');
			this.eyeB.rotation.set(0,THREE.Math.lerp(this.eyeB.rotation.y,alpha+0.4,k),THREE.Math.lerp(this.eyeB.rotation.z,beta-Math.PI/2,k),'XYZ');
			break;
		case 1:
			this.fly2.visible = true;
			this.eyeA.rotation.set(0,THREE.Math.lerp(this.eyeA.rotation.y,alpha-0.4,k),THREE.Math.lerp(this.eyeA.rotation.z,beta-Math.PI/2,k),'XYZ');
			this.eyeB.rotation.set(0,THREE.Math.lerp(this.eyeB.rotation.y,alpha2+0.4,k),THREE.Math.lerp(this.eyeB.rotation.z,beta2-Math.PI/2,k),'XYZ');
			break;
	}
	
	TWEEN.update();
	reanimate();
}



// информатор на модела
MEIRO.Models.M29102.prototype.onInfo = function(element)
{
	var s = '';
	s += '<h1>Поглед на хамелеон и на изненадан лемур</h1>';

	s += '<p>При активиране на погледа на хамелеон всяко око следи свое топче и се движи независимо от гругото око.</p>';
	s += '<p>При активиране на погледа на изненадана коала се сменя мащабът на текстурата, което прави зеницата разширена.</p>';
	element.innerHTML = s;
}




// превключвател на модела
MEIRO.Models.M29102.prototype.onToggle = function(element)
{
	this.state = (this.state+1)%2;
	this.k = 0;
	
	reanimate();
}

// превключвател на модела
MEIRO.Models.M29102.prototype.onWide = function(element)
{
	var that = this;
	new TWEEN.Tween({w:that.w})
		.to({w:that.w<1.01?1.15:1},500)
		.easing( TWEEN.Easing.Quadratic.InOut )
		.onUpdate( function(){that.w=this.w} )
		.start();

	reanimate();
}
